    "refuge-narrative-report-january-through-april-1963-kodiak-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Kodiak NWR outlines
    Refuge accomplishments from January through April of 1963. The report begins by
    summarizing the weather conditions, habitat conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, rodents, raptors, and fish- is also covered. The Refuge
    development and maintenance section discusses physical developments and wildfires.
    Resource management is outlined; topics include fur harvesting. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    and hunting. Items of interest, N-R forms, and photographs are attached.",nt"license_title":
